import * as React from 'react';
import Link from 'next/link';
import { NextPage } from 'next';

const Home = () => {
    return (
        <div>
            <Link href="/">
                <a>Home</a>
            </Link>
            <Link href="/about">
                <a>About</a>
            </Link>
        </div>
    );
};

export default Home;
